        //  VCVTDQ2PDâ [ Brief : Packed Dword Integers to Packed Double Precision FP Values ]
        m_instTypeLUT[0xE6] |= InstTypes_AVXLeadBy0x0F;

        // VCVTDQ2PSâ [ Brief : Packed Dword Integers to Packed Single Precision FP Values ]
