///////////////////////////////////////////////////////////////////////////
IDASMErrorCode_t Tables_t::_InitializeOpCodeTable()
{
    m_opCodeTable1    = reinterpret_cast<Standard::OpCodeDesc_t*>(malloc(STD_OPCODE_TABLE_SIZE));
    m_opCodeTable2    = reinterpret_cast<Standard::OpCodeDesc_t*>(malloc(STD_OPCODE_TABLE_SIZE));
    m_opCodeTable3_38 = reinterpret_cast<Standard::OpCodeDesc_t*>(malloc(STD_OPCODE_TABLE_SIZE));
    m_opCodeTable3_3A = reinterpret_cast<Standard::OpCodeDesc_t*>(malloc(STD_OPCODE_TABLE_SIZE));
    assert(m_opCodeTable1 != nullptr && m_opCodeTable2 != nullptr && m_opCodeTable3_38 != nullptr && m_opCodeTable3_3A != nullptr && 
            "Memory allocation to opcode tables failed!");

    memset(m_opCodeTable1,    0, STD_OPCODE_TABLE_SIZE);
    memset(m_opCodeTable2,    0, STD_OPCODE_TABLE_SIZE);
    memset(m_opCodeTable3_38, 0, STD_OPCODE_TABLE_SIZE);
    memset(m_opCodeTable3_3A, 0, STD_OPCODE_TABLE_SIZE);


    for (int i = 0; i <= 0xFF; i++)
    {
        m_opCodeTable1[i].Reset();
        m_opCodeTable2[i].Reset();
        m_opCodeTable3_38[i].Reset();
        m_opCodeTable3_3A[i].Reset();
    }


    _InitOneByteOpCodeTable();
    _InitTwoByteOpCodeTable();
    _InitThreeByteOpCodeTable_38();
    _InitThreeByteOpCodeTable_3A();

        
    // Setting Escape characters...
    m_opCodeTable1[SpecialChars::ESCAPE_OPCODE_FIRST_INDEX].m_bIsEscapeCode     = true;
    m_opCodeTable2[SpecialChars::ESCAPE_OPCODE_SECOND_INDEX_38].m_bIsEscapeCode = true;
    m_opCodeTable2[SpecialChars::ESCAPE_OPCODE_SECOND_INDEX_3A].m_bIsEscapeCode = true;
    m_opCodeTable1[SpecialChars::ESCAPE_OPCODE_FIRST_INDEX].m_bIsValidCode      = true;
    m_opCodeTable2[SpecialChars::ESCAPE_OPCODE_SECOND_INDEX_38].m_bIsValidCode  = true;
    m_opCodeTable2[SpecialChars::ESCAPE_OPCODE_SECOND_INDEX_3A].m_bIsValidCode  = true;


    return IDASMErrorCode_t::IDASMErrorCode_Success;
}


